// SPDX-License-Identifier: MIT
pragma solidity ^0.8.22;

import {ERC20} from "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import {Ownable} from "@openzeppelin/contracts/access/Ownable.sol";

contract MLAMPL is ERC20, Ownable {
    event Rebase(int256 rebaseRate, uint256 newTotalSupply);

    uint256 private scalingFactor = 1e18; // Starts at 1.0 (1e18 to handle decimals)

    constructor(address initialOwner)
        ERC20("ML AMPL", "mlAMPL")
        Ownable(initialOwner)
    {}

    /**
     * @dev Adjust the token supply proportionally based on a rebase rate.
     * @param rebaseRate The percentage change in supply, scaled by 1e6 (e.g., 100000 = 10% increase, -100000 = 10% decrease).
     */
    function rebase(int256 rebaseRate) external onlyOwner {
        require(rebaseRate != 0, "Rebase rate cannot be zero");

        if (rebaseRate > 0) {
            scalingFactor = (scalingFactor * (1e6 + uint256(rebaseRate))) / 1e6;
        } else {
            scalingFactor = (scalingFactor * (1e6 - uint256(-rebaseRate))) / 1e6;
        }

        emit Rebase(rebaseRate, totalSupply());
    }

    /**
     * @dev Override balanceOf to apply scaling factor.
     * @param account The address of the token holder.
     * @return The scaled balance of the account.
     */
    function balanceOf(address account) public view override returns (uint256) {
        uint256 rawBalance = super.balanceOf(account);
        return (rawBalance * scalingFactor) / 1e18;
    }

    /**
     * @dev Override totalSupply to reflect scaled balances.
     * @return The scaled total supply.
     */
    function totalSupply() public view override returns (uint256) {
        uint256 rawTotalSupply = super.totalSupply();
        return (rawTotalSupply * scalingFactor) / 1e18;
    }
}

